        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas obcaecati perferendis qui. Neque suscipit hic at dignissimos optio voluptatibus consequatur temporibus ipsam eaque! Consequuntur vel, quo officiis error alias quae?</p>
      </section>

      <Footer />

    </>
  );
}

export default MainPage;
